import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
  value = "default";
  onSubmit(event: any) {
    this.value = event.target.player.value;
      return event.target.player.value;
  }
  public getInput(){

  }
}
<h1>Lynkz Code Puzzle</h1>
<h2>Shape Generator</h2>
<p>Please enter what shape you would to generate.</p>
<p>Here are some examples:</p>
<ul>
  <li><i>Draw a circle with a radius of 100</i></li>
  <li><i>Draw a square with a side length of 200</i></li>
  <li><i>Draw a rectangle with a width of 250 and a height of 400</i></li>
  <li><i>Draw an octagon witha side length of 200</i></li>
  <li><i>Draw an isosceles triangle with a height of 200 and width of 100</i></li>
</ul>
<form>
  <div class="form-group" (ngSubmit)="onSubmit($event)">
    <input class="form-control" placeholder="Specify what to draw here">
  </div>
  <button type="submit" value="Submit">Submit</button>
  Your name is: {{value}}
</form>

